const baseUrl = 'https://dev-agwa-public-static-assets-web.s3-us-west-2.amazonaws.com/data/catalogs';

axios({
    method: 'get',
    url: `${baseUrl}/plants`,
  }).then((response) => {
    console.log(response.data);
  });

  axios.get(`${baseUrl}/api/users/1`).then((response) => {
    console.log(response.data);
  });

